module .exports = ( socket, request ) => {

socket .on ( 'pass', ( pass ) => {

socket .send ( 'Pass: ' + pass .pid );

socket .on ( 'message', ( data ) => {

pass .stdin .write ( data );

} );

pass .stdout .setEncoding ( 'utf8' );
pass .stdout .on ( 'data', ( data ) => {

socket .send ( data );

} );

} );

require ( './pass' ) ( socket );

};
